import React, { useEffect } from 'react';

function Map() {
  useEffect(() => {
    // Inicijalizacija mape
    function initMap() {
      var map = new window.google.maps.Map(document.getElementById('map'), {
        center: { lat: 44.0165, lng: 21.0059 }, // Postavite centar mape prema geografskim koordinatama Srbije
        zoom: 7
      });

      // Dodajte marker za svaki sportski centar
      var sportskiCentar1 = new window.google.maps.Marker({
        position: { lat: 44.7872, lng: 20.4573 }, // Postavite geografske koordinate prvog sportskog centra
        map: map,
        title: 'Sportski Centar 1'
      });

      // Dodajte još markera prema potrebi
      // ...
    }

    // Provera da li je window.google definisan (da biste izbegli greške pri učitavanju)
    if (!window.google) {
      console.error('Google Maps API nije dostupan.');
      return;
    }

    // Poziv funkcije za inicijalizaciju mape
    initMap();
  }, []);

  return <div id="map" style={{ height: '400px' }}></div>;
}

export default Map;
